import './App.css'
import search from '../Search/Search';
import Header from './../Header/Header';

class App extends React.Component{
    constructor(){
        super();
        this.state={
            headerText : "Hello"
        };
}
    render(){
        return (
            <div>
                <Header headerTitle={this.state.headerText}/>
                <search />
            </div>
        )
    };
